label("$A$",(-42.4,30.8),W);
label("$F$",(-10,30.8),NW);
dot((-10,30.8));
label("$G$",(10,30.8),NE);
dot((10,30.8));
label("$H$",(16.2,11.8),E);
dot((16.2,11.8));
label("$I$",(0,0),S);
dot((0,0));
label("$J$",(-16.2,11.8),WSW);
dot((-16.2,11.8));
[/asy]

