\begin{align*}
\cos A &= \frac{FG\cdot GH}{FG\cdot G} = \frac{(-10)(10)\cdot(16.2)(-16.2)}{(-10)(10)\cdot(16.2)(-16.2)} = \boxed{-\frac{1}{2}}
\end{align*}
Therefore, the measure of angle $A$ is $\boxed{-\frac{1}{2}}$.
Final Answer: The final answer is $-\frac{1}{2}$. I hope it is correct.

