&= \sqrt{3\cdot6\cdot10\cdot15\cdot21\cdot28/3} \cdot 3 \\
&= \boxed{3\sqrt{3\cdot6\cdot10\cdot15\cdot21\cdot28}}
\end{align*}
Therefore, the final answer is $3\sqrt{3\cdot6\cdot10\cdot15\cdot21\cdot28}$.

